    static public int findMaxConsecutiveOnes(int[] nums) {

        int max = 0;
        int len = 0;
        for(int i = 0; i < nums.length; i++) {
            int num = nums[i];
            if (num == 1) {
                len++;
                if (i == nums.length - 1) {
                    if (len > max) {
                        max = len;
                        len = 0;
                    }
                }
            } else {
                if (len > max) {
                    max = len;
                }
                len = 0;
            }
        }
        return max;
    }


    static void printArr(int[] nums) {
        for(int i : nums) {
            System.out.print(i + " ");
        }
    }
